    false,nt"url": null,nt"notes": "NCEI Accession 0152500 includes physical,
    profile and underway data collected aboard the NEW HORIZON during cruise NH1410
    in the North Pacific Ocean from 2014-05-10 to 2014-06-08. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
    ADCP, CTD and GPS. These data were collected by Frank Stewart of Georgia Institute
    of Technology, and by University of California - San Diego; Scripps Institution
    of Oceanography as part of Genomic understanding of microbial sulfur cycling in
    oxygen minimum zones. The Lamont-Doherty Earth Observatory (LDEO) submitted these
    data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
    ADCP data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"license_title": null,nt"extras":
